import React , { Component } from 'react';

class GetStarted extends Component{
    render(){
        return(
        <div>
            <h2>Welcome to the Tony's world of Artificial Intelligence</h2>
            <h3> Overview of features </h3>
            <ol>
                <li>
                    <h3>Face Landmark Detection</h3>
                    <p>This feature will allow you to play with Tensorflow's face detection model</p>
                </li>
            </ol>
        </div>

        );
    }
}

export default GetStarted;
